import './stilo.css'
import Inicio from './componentes/Inicio';
function App() {
  const [inicio,setInicio]=useState("inicio_on")
  function quitar(){
    setInicio("inicioo_off")
  }
  return (
    <BrowserRouter>
      <Routes>
      <Route path='/' element={<Inicio/>}/>
      <Route path='/p' element={<Prueba/>}/>
      <Route path='/c' element={<Pruebados/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
